import Drawer from '@material-ui/core/Drawer'
import Typography from '@material-ui/core/Typography'

const Layout = ({children}) => {
    return ( 

        <div>

            {/** toolbar */}
            {/**menu droite */}
            <Drawer
            variant = "permanent"
            anchor = 'left'
            >
                <div>
                    <Typography variant="h5">
                        test de la nav bar

                    </Typography>
                </div>
            </Drawer>


            {/**future page */}
            {children}
        </div>
     );
}
 
export default Layout;
